					"description": "<!-- TODO: move me to components.dark -->\n<p>Use the <code>.pt-dark</code> class to apply dark text colors <em>and</em> to cascade the dark theme to descendants.\nThis only applies colors to text; you&#39;ll have to set a background color yourself. Blueprint&#39;s\ndark background color is aliased as <code>$pt-dark-app-background-color</code>.</p>\n",
