									"header": "Vertical button groups",
									"description": "<p>Add the class <code>pt-vertical</code> to create a vertical button group. The buttons in a vertical\ngroup all have the same size as the widest button in the group.</p>\n<p>Add the modifier class <code>pt-align-left</code> to left-align all button text and icons.</p>\n<p>You can also combine vertical groups with the <code>pt-fill</code> and <code>pt-minimal</code> class modifiers.</p>\n",
