							"description": "<p>Start with <code>.pt-card</code> and add an elevation modifier class to apply a drop shadow that simulates\nheight in the UI.</p>\n<p>You can also use the <code>.pt-elevation-*</code> classes by themselves to apply shadows to any arbitrary\nelement.</p>\n",
