									"header": "Disabled labels",
									"description": "<p>Add the <code>.pt-label</code> and <code>.pt-disabled</code> class modifiers to a <code>&lt;label&gt;</code> to make the label appear\ndisabled.</p>\n<p>This styles the label text, but does not disable any nested children like inputs or selects. You\nmust add the <code>:disabled</code> attribute directly to any nested elements to disable them. Similarly the respective\n<code>pt-*</code> form control will need a <code>.pt-disabled</code> modifier. See the examples below.</p>\n",
									"modifiers": [],
									"parameters": [],
