									"header": "Form groups",
									"description": "<p>Form groups support more complex form controls than <a href=\"#components.forms.labels.simple-labels\">simple labels</a>,\nsuch as <a href=\"#components.forms.control-group\">control groups</a> or <a href=\"#components.forms.numeric-input\"><code>NumericInput</code></a>.\nThey also support additional helper text to aid with user navigation.</p>\n<ul>\n<li><p>Link each label to its respective control element with a <code>for={#id}</code> attribute on the <code>&lt;label&gt;</code> and\n<code>id={#id}</code> on the control.</p>\n</li>\n<li><p>Add <code>.pt-intent-*</code> or <code>.pt-disabled</code> to <code>.pt-form-group</code> to style the label and helper text.\nSimilar to labels, nested controls need to be styled separately.</p>\n</li>\n<li><p>Add <code>.pt-inline</code> to <code>.pt-form-group</code> to place the label to the left of the control.</p>\n</li>\n<li><p>Add <code>.pt-large</code> to <code>.pt-form-group</code> to align the label when used with large inline Blueprint controls.</p>\n</li>\n</ul>\n",
									"modifiers": [],
									"parameters": [],
