									"header": "Inline controls",
									"description": "<p>Checkboxes, radios, and switches all support the <code>.pt-inline</code> modifier to make them <code>display:\ninline-block</code>. Note that this modifier functions slightly differently on these elements than it\ndoes on <code>.pt-label</code>. On <code>.pt-label</code>, it only adjusts the layout of text <em>within</em> the label and not\nthe display of the label itself.</p>\n<p>Here&#39;s an example of how you might group together some controls and label them.</p>\n",
									"modifiers": [],
									"parameters": [],
									"markup": "<label class=\"pt-label\">A group of related options</label>\n<label class=\"pt-control pt-checkbox pt-inline\">\n  <input type=\"checkbox\" />\n  <span class=\"pt-control-indicator\"></span>\n  First\n</label>\n<label class=\"pt-control pt-checkbox pt-inline\">\n  <input type=\"checkbox\" />\n  <span class=\"pt-control-indicator\"></span>\n  Second\n</label>\n<label class=\"pt-control pt-checkbox pt-inline\">\n  <input type=\"checkbox\" />\n  <span class=\"pt-control-indicator\"></span>\n  Third\n</label>",
