									"header": "JavaScript API",
									"description": "<p>The <code>InputGroup</code> component is available in the <strong>@blueprintjs/core</strong> package. Make sure to review\nthe <a href=\"#components.usage\">general usage docs for JS components</a>.</p>\n<p>The <code>InputGroup</code> React Component encapsulates the <code>.pt-input-group</code>\n<a href=\"#components.forms.input-group.css\">CSS API</a>: it supports one non-interactive icon on the left side\nand one arbitrary element on the right side. Unlike the CSS API, the React Component supports\n<em>content of any length</em> on the right side, not just icon buttons, because it is able to measure the\ncontent and ensure there is always space for it.</p>\n<p><code>InputGroup</code> can be used just like a standard React <code>input</code> element, in controlled or uncontrolled\nfashion. In addition to its own content props, it supports all valid props for HTML <code>input</code> elements\nand proxies them to that element in the DOM; the most common ones are detailed below.</p>\n\n\n",
									"modifiers": [],
