											"header": "SVG spinner",
											"description": "<p>Use the <code>SVGSpinner</code> component to render a spinner inside an SVG element.</p>\n<div class=\"pt-callout pt-intent-primary pt-icon-info-sign\">\n  <h5>Sizing note</h5>\n  Because of the way SVG elements are sized, you may need to manually scale the spinner inside your\n  SVG to make it an appropriate size.\n</div>",
