									"header": "CSS API",
									"description": "<p>Apply the class <code>.pt-skeleton</code> to elements that you would like to cover up with a loading animation.\nThe skeleton inherits the dimensions of whatever element the class is applied to. This means that\nwhen using skeletons to show loading text, you should use some sort of placeholder text that is\napproximately the length of your expected text.</p>\n<div class=\"pt-callout pt-intent-warning pt-icon-warning-sign\">\n  <h5>Manually disable focusable elements</h5>\n  When using the <code>.pt-skeleton</code> class on focusable elements such as inputs and buttons, be sure to\n  disable the element, via either the <code>disabled</code> or <code>tabindex=&quot;-1&quot;</code> attributes. Failing to do so\n  will allow these skeleton elements to be focused when they shouldn&#39;t be.\n</div>",
