					"header": "Table (React)",
					"description": "<p>A highly interactive table React component.</p>\n<div class=\"pt-callout pt-large pt-intent-primary pt-icon-info-sign\">\n  If you are looking instead for the Blueprint-styled HTML table, see <a href=\"#components.table\"><strong>the previous section</strong></a>.\n</div>\n\n<h3 id=\"features\">Features</h3>\n<ul>\n<li>High-scale, data-agnostic</li>\n<li>Customizable cell and header rendering</li>\n<li>Virtualized viewport rendering</li>\n<li>Selectable rows, columns and cells</li>\n<li>Resizable rows and columns</li>\n<li>Editable headers and cells</li>\n<li>Integrated header and context menus</li>\n</ul>\n",
