							"description": "<pre class=\"editor editor-colors\"><div class=\"line\"><span class=\"text plain null-grammar\"><span>npm&nbsp;install&nbsp;--save&nbsp;@blueprintjs/core&nbsp;@blueprintjs/table</span></span></div></pre>",
