							"description": "<p>The <code>Tag</code> component is available in the <strong>@blueprintjs/core</strong> package.\nMake sure to review the <a href=\"#components.usage\">general usage docs for JS components</a>.</p>\n<p>Tag components render <code>.pt-tag</code> elements with optional close buttons. Provide tag content as <code>children</code>.</p>\n<p>You can provide your own props to these components as if they were regular JSX HTML elements. If\nyou provide a <code>className</code> prop, the class names you provide will be added alongside of the default\nBlueprint class name.</p>\n<pre class=\"editor editor-colors\"><div class=\"line\"><span class=\"source tsx\"><span class=\"tag open tsx\"><span class=\"punctuation definition tag begin tsx\"><span>&lt;</span></span><span class=\"entity name tag tsx\"><span>Tag</span></span><span class=\"meta tag attribute-name tsx\"><span>&nbsp;</span><span class=\"entity other attribute-name tsx\"><span>intent</span></span></span><span class=\"keyword operator assignment tsx\"><span>=</span></span><span class=\"meta brace curly tsx\"><span class=\"punctuation definition brace curly start tsx\"><span>{</span></span><span>Intent.PRIMARY</span><span class=\"punctuation definition brace curly end tsx\"><span>}</span></span></span><span class=\"meta tag attribute-name tsx\"><span>&nbsp;</span><span class=\"entity other attribute-name tsx\"><span>onRemove</span></span></span><span class=\"keyword operator assignment tsx\"><span>=</span></span><span class=\"meta brace curly tsx\"><span class=\"punctuation definition brace curly start tsx\"><span>{</span></span><span class=\"constant language this tsx\"><span>this</span></span><span>.deleteTag</span><span class=\"punctuation definition brace curly end tsx\"><span>}</span></span></span><span class=\"punctuation definition tag end tsx\"><span>&gt;</span></span></span><span class=\"meta jsx children tsx\"><span>Done</span></span><span class=\"tag close tsx\"><span class=\"punctuation definition tag begin tsx\"><span>&lt;/</span></span><span class=\"entity name tag tsx\"><span>Tag</span></span><span class=\"punctuation definition tag end tsx\"><span>&gt;</span></span></span></span></div><div class=\"line\"><span class=\"source tsx\"><span class=\"comment line tsx\"><span>//&nbsp;renders:</span></span></span></div><div class=\"line\"><span class=\"source tsx\"><span class=\"tag open tsx\"><span class=\"punctuation definition tag begin tsx\"><span>&lt;</span></span><span class=\"entity name tag tsx\"><span>span</span></span><span class=\"meta tag attribute-name tsx\"><span>&nbsp;</span><span class=\"entity other attribute-name tsx\"><span>class</span></span></span><span class=\"keyword operator assignment tsx\"><span>=</span></span><span class=\"string quoted double tsx\"><span class=\"punctuation definition string begin tsx\"><span>&quot;</span></span><span>pt-tag&nbsp;pt-intent-primary&nbsp;pt-tag-removable</span><span class=\"punctuation definition string end tsx\"><span>&quot;</span></span></span><span class=\"punctuation definition tag end tsx\"><span>&gt;</span></span></span></span></div><div class=\"line\"><span class=\"source tsx\"><span class=\"meta jsx children tsx\"><span>&nbsp;&nbsp;Done</span></span></span></div><div class=\"line\"><span class=\"source tsx\"><span class=\"meta jsx children tsx\"><span>&nbsp;&nbsp;</span><span class=\"tag open tsx\"><span class=\"punctuation definition tag begin tsx\"><span>&lt;</span></span><span class=\"entity name tag tsx\"><span>button</span></span><span class=\"meta tag attribute-name tsx\"><span>&nbsp;</span><span class=\"entity other attribute-name tsx\"><span>class</span></span></span><span class=\"keyword operator assignment tsx\"><span>=</span></span><span class=\"string quoted double tsx\"><span class=\"punctuation definition string begin tsx\"><span>&quot;</span></span><span>pt-tag-remove</span><span class=\"punctuation definition string end tsx\"><span>&quot;</span></span></span><span class=\"meta tag attribute-name tsx\"><span>&nbsp;</span><span class=\"entity other attribute-name tsx\"><span>onClick</span></span></span><span class=\"keyword operator assignment tsx\"><span>=</span></span><span class=\"meta brace curly tsx\"><span class=\"punctuation definition brace curly start tsx\"><span>{</span></span><span class=\"constant language this tsx\"><span>this</span></span><span>.deleteTag</span><span class=\"punctuation definition brace curly end tsx\"><span>}</span></span></span><span class=\"punctuation definition tag end tsx\"><span>&gt;</span></span></span></span><span class=\"tag close tsx\"><span class=\"punctuation definition tag begin tsx\"><span>&lt;/</span></span><span class=\"entity name tag tsx\"><span>button</span></span><span class=\"punctuation definition tag end tsx\"><span>&gt;</span></span></span></span></div><div class=\"line\"><span class=\"source tsx\"><span class=\"tag close tsx\"><span class=\"punctuation definition tag begin tsx\"><span>&lt;/</span></span><span class=\"entity name tag tsx\"><span>span</span></span><span class=\"punctuation definition tag end tsx\"><span>&gt;</span></span></span></span></div></pre>\n\n",
