							"header": "JavaScript API",
							"description": "<p>The <code>Tree</code> component is available in the <strong>@blueprintjs/core</strong> package.\nMake sure to review the <a href=\"#components.usage\">general usage docs for JS components</a>.</p>\n<p><code>Tree</code> is a stateless component. Its contents are dictated by the <code>contents</code> prop, which is an array\nof <code>ITreeNode</code>s (see <a href=\"#components.tree.js.treenode\">below</a>). The tree is multi-rooted if <code>contents</code>\ncontains more than one top-level object.</p>\n<p>A variety of interaction callbacks are also exposed as props. All interaction callbacks supply a\nparameter <code>nodePath</code>, which is an array of numbers representing a node&#39;s position in the tree. For\nexample, <code>[2, 0]</code> represents the first child (<code>0</code>) of the third top-level node (<code>2</code>).</p>\n\n\n",
